import React from "react";

var tempDate = new Date();
var date =
  tempDate.getFullYear() +
  "-" +
  (tempDate.getMonth() + 1) +
  "-" +
  tempDate.getDate() +
  " " +
  tempDate.getHours() +
  ":" +
  tempDate.getMinutes();
var currDate = date;

function Footer() {
  return (
    <div class="footer">
      This footer will always be positioned at the bottom of the page, but{" "}
      <strong>not fixed</strong>.
    </div>
  );
}

export default Footer;
